import { Pipe, PipeTransform } from '@angular/core';
import {INamed} from "../additional/INamed";
import {Gender} from "../entity/Gender";

@Pipe({
  name: 'convertToGender'
})
export class ConvertToGenderPipe implements PipeTransform {

  transform(namedObjects: INamed[]): Gender[] {
    let genders: Gender[namedObjects.length];
    for (let i = 0; i < namedObjects.length; i++) {
      genders[i] = namedObjects[i] as Gender;
    }
    return genders;
  }
}
